import React from 'react';
import { Link } from 'react-router-dom';

import './style/Header.css';
const avengers = 'https://thefunquotes.com/wp-content/uploads/2020/09/THEFUNQUOTES.COM-2-85-1024x1024.jpg'

const Header = () => {
    return (
        <header className="header">
            <img src='avengers' className="logo" alt="avengers" />
            <h1>AVENGERS AWU BLOG </h1>
            <nav>
                <ul>

                    {/*<li className="item"><Link to="/contact">Contact Us</Link></li>*/}
                    <li className="item-button">Login</li>
                    <li className="item-button">Register</li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
